import React from 'react';

// Helper to render base64 icons
const IconImg = ({ src, alt, ...props }) => (
  <img 
    src={src} 
    alt={alt} 
    loading="lazy"
    {...props} 
  />
);

export const ReactIcon = (props) => <IconImg src="data:image/svg+xml;base64," alt="React" {...props} />;
export const NodeIcon = (props) => <IconImg src="data:image/svg+xml;base64," alt="Nodejs" {...props} />;
